@Override
public boolean equals(Object other) {
  if (super.equals(other) && other instanceof BKDPointInBBoxQuery) {
    final BKDPointInBBoxQuery q = (BKDPointInBBoxQuery) other;
    return field.equals(q.field) &&
      minLat == q.minLat &&
      maxLat == q.maxLat &&
      minLon == q.minLon &&
      maxLon == q.maxLon;
  }

  return false;
}

